import { BrowserRouter, Route } from "react-router-dom";
import "./App.css";
import AdminPage from "./pages/adminPage";
import UserPage from "./pages/userPage";

function App() {
  return (
    <BrowserRouter>
      <Route path="/adminPage" component={AdminPage}>
        Admin
      </Route>

      <Route path="/userPage" component={UserPage}>
        User
      </Route>
    </BrowserRouter>
  );
}

export default App;
